script: |
  super -f text -I q1964.spq | sort > q1964.out

inputs:
  - name: q1964.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 BETWEEN CAST ( - 91 AS INTEGER ) / - 99 - ( 43 + col2 ) AND 89 * - 62;
  - name: tab2

outputs:
  - name: q1964.out
    data: |
      46	51	23
      64	77	40
      75	67	58
